import React from "react";

const App = () => {
  const fruits = [
    { name: "apple" , calories:95},
    { name: "banana",calories:100},
    { name: "strawberry",calories:25 },
    { name: "orange" },
    { name: "grape" },
  ];
  const item = fruits.map((fruit) => <li>{fruit}</li>);
  return (
    <>
      <ol>{item}</ol>
      <h1>hello world</h1>
      <h2>{fruits.sort()}</h2>
    </>
  );
};

export default App;
